A TransferRequest can only be matched in a TransferPolicy object. The match happens based on the type of the TransferRequest and the TransferPolicy. If the TransferRequest is for the "Phone" type, it can only be matched by the TransferPolicy for the "Phone" type. In the example above the TransferRequest is for the "VAT" type, so it can only be matched by the TransferPolicy for the "VAT" type. TransferPolicy<T> is a Sui Object which can be created for any type by the Publisher of this type. /// An example of a TransferPolicy setup. Better be done via PTBs and not as a
/// published module. The code below is for illustration purposes only.
module tax::vat { use sui::tx_context::{sender, TxContext}; use sui::transfer_policy::{Self, TransferPolicy}; /// The authority defines the `VAT` type. It is never initialized and only /// used to create and resolve `TransferRequest`s. struct VAT has drop {} /// The publisher creates and shares a `TransferPolicy` for the `VAT` type. public fun create_policy(pub: &Publisher, ctx: &mut TxContext) { let (policy, policy_cap) = transfer_policy::new_policy<VAT>(pub, ctx); sui::transfer::public_share_object(policy); sui::transfer::public_transfer(policy_cap, sender(ctx)); } /// Can be called directly in the `TransferPolicy` module; does not need a /// custom implementation. This code is for illustration purposes only. public fun confirm_request( policy: &TransferPolicy<VAT>, request: TransferRequest<VAT> ) { transfer_policy::confirm_request<VAT>(policy, request); }
}
